import React from 'react'
import styled from "styled-components";
function Home() {

    return (
       <Container>
         <Title>Model S </Title>
       </Container>
    )
}

export default Home

const Container = styled.div `
  background-image:url('images/model-s.jpg');
  height:100vh;
  width:100%;
  background-size:cover;
  background-position:center;
  flex-wrap:nowrap;
  `
const Title = styled.h1`
   padding-top:100px ;
  text-align: center;
  border: transparent;
  font-size:50px ;
  fon-weight:400

`
